        return (
        <header>
            <img src={this.logo}/>
      <nav>
          <ul>
              <li>ACCUEIL</li>
              <li>TENDANCES</li>
              <li>ADMIN</li>
              <li>CONNEXION</li>

              </ul>
              </nav>
              </header>
        );
    }
}

export default Header;
